import { useStarknet } from '@starknet-react/core';
import { Navig, Homeb1, Homeb2 } from '../components/home';
import { MaxBuyPerTx, MaxSupplyForMint, PaymentTokenAddress, ProjectNFTAddress, PublicSaleOpen, ReservedSupplyForMint, UnitPrice, WhitelistedSaleOpen, WhitelistMerkleRoot } from '../components/NFT';
import { ConnectButton, DisconnectButton } from '../components/Wallet';
import { MINTER_CONTRACT_ADDRESS } from '../contracts/addresses';
import { Parallax, ParallaxLayer } from '@react-spring/parallax'




function TestPage() {
    const { account } = useStarknet();


    return (

        <>

        <Parallax pages={3} className="bg-black" style={{}}>

        <ParallaxLayer
        offset={0}
        speed={0.5}
        style={{ }}>
            <div className='bg-black w-screen grid place-content-center justify-items-center'>
                <div className=" w-screen max-w-screen-2xl  grid grid-cols-12 justify-items-center place-self-center justify-self-center px-20 bg-black min-h-screen content-start position relative">
                    <img src="dancerhome.png" className=' col-span-12 w-full h-full object-cover absolute z-0' alt="" />
                    <Navig />
                    <Homeb1 />
                </div>
            </div>
        </ParallaxLayer>


        <ParallaxLayer
            sticky={{ start: 1, end: 3 }}
            className="z-0"
            >
            <div className='w-screen grid place-content-center justify-items-center z-20'>
                <Homeb2 />
            </div>
        </ParallaxLayer>

        <ParallaxLayer offset={1} speed={0.5} style={{ backgroundColor: '#000000' }} />

        <ParallaxLayer
            offset={1}
            speed={-0.1}
            className='grid grid-cols-12 grid-rows-6 '
            >
            <div className='grid col-end-12 col-span-1 row-span-2 '> 
                <h1 className="grid  justify-center content-center text-7xl font-extralight text-white">+</h1>
            </div>
        </ParallaxLayer>

        <ParallaxLayer
        offset={1}
        speed={-0.2}
        className='grid grid-cols-12 grid-rows-6 z-50 '
        >
        <div className='col-span-12  row-end-6 row-span-3 w-full grid  content-center h-4/5 place-self-center' >
                   <div className='grid row-span-3 justify-center content-center text-7xl font-extrabold text-white text-center '>
                        <h1>WE BUILD TECH TO MAKE ART MORE ACCESSIBLE</h1> 
                    </div>

        </div>
        </ParallaxLayer>    
         </Parallax>
        </>


    );
}

export default TestPage;
